import React, { useState, useEffect } from "react";
import { Vehicle, VehicleFilter } from "./data/vehicles/contracts";
import { VehicleApi } from "./data/vehicles/api";
import { Filter } from "./components/Filter";
import { Table } from "./components/Table";
import { Input } from "@skbkontur/react-ui";
import { VehicleTypeSelect } from "./components/VehicleTypeSelect";

const initialFilter: VehicleFilter = {
  title: "",
  type: null,
};

export default function App() {
  const [vehicles, setVehicles] = useState<Vehicle[]>([]);

  useEffect(() => {
    const data = VehicleApi.search(SourseFilter);
    const [filter, setFilter] = useState(SourseFilter);
    setVehicles(data);
  }, []);

  return (
    <>
      <Filter />
      <Table vehicles={vehicles} />
    </>
  );
}

const SourseFilter: VehicleFilter = {
  title: "",
  type: null,
};
